/* this file is transformed by vux-loader */
/* eslint-disable */
import Vue from 'vue';
import App from "./App.vue";
import router from "./router";
import store from "./store";
import Divider from "vux/src/components/divider/index.vue" // this line is trasformed by vux-loader
import Flexbox from "vux/src/components/flexbox/flexbox.vue" // this line is trasformed by vux-loader
import FlexboxItem from "vux/src/components/flexbox/flexbox-item.vue" // this line is trasformed by vux-loader
Vue.component('divider', Divider);
Vue.component('flexbox', Flexbox);
Vue.component('flexbox-item', FlexboxItem);
Vue.config.productionTip = false;
new Vue({
  router: router,
  store: store,
  render: function render(h) {
    return h(App);
  }
}).$mount('#app');
